import React from 'react'
import { NavLink } from 'react-router-dom';

const Card = (props) => {
    return(
        <div class="col card">
                <div class="card shadow">
                <h5 class="card-header d-flex justify-content-center">{props.name}</h5>
                    <div class="card-body">
                        <p class="card-text">{props.description}</p>
                    </div>
                <div class="card-footer d-flex justify-content-center">
                    <NavLink to={props.navigate} className="btn btn-card">Wybieram</NavLink>
                </div>
                 </div>        
        </div>

    );
}

export default Card;
